import React, {Component, Fragment} from 'react';
import './main.sass';

import {  
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from 'react';

// pages 
import Project from './containers/Project';


function App () {

  return (
    <Router>
      <Switch>
        <Route path="/">
          <Project />
        </Route>
        <Route path="/project">
          <Project />
        </Route>
      </Switch>
    </Router>

  );

}

export default App;
